import {Navigate} from 'react-router-dom';

const ProtectedRoute = (({children, isLoggedIn}) => {
  if (!isLoggedIn) {
    return <Navigate to={'/sign-in'}/>;
  }
  return (children);
})

export default ProtectedRoute;
